const Projects = () => {
  const [currentSlide, setCurrentSlide] = useState(0);
  const data = [
    {
      id: "2",
      title: "Arcade Gameüëæ",
      desc: "ÈõÜÁµêÈÅéÂæÄ‰ΩøÁî® Vanilla JavaScript ÊâÄÁ∑¥ÁøíÊí∞ÂØ´ÁöÑÊúâË∂£Â∞èÈÅäÊà≤ÔºåHAVE FUN!",
